      <p className="user-name">{userInfo.name}</p>
      <button
        className={`connection-statut ${isConnected ? 'connected' : 'disconnected'}`}
      >
        {isConnected ? 'Connecté' : 'Déconnecté'}
      </button>
    </div>
  )
};

export default Contact;
